import React from 'react';
import './DownloadSection.css';

const DownloadSection = () => {
  return (
    <section className="download-section">
      <div className="content-wrapper">
        <div className="mobile-image">
          <img src="images/mobileapp.png" alt="Mobile App" />
        </div>
        <div className="content">
          <h1>Download our Kyan Mobile App</h1>
          <p>We look forward to you using our app! It will help you understand...</p>
          <div className="Apps">
            <div className="img1">
              <a href="https://play.google.com"><img src="images/image.png" alt="Google Play" /></a>
            </div>
            <div className="img2">
              <a href="https://apps.apple.com"><img src="images/imgs.png" alt="Apple Store" /></a>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default DownloadSection;
